window.bookSummaryJSON = "<p><i>USA Today</i> best-selling romance from Pepper Winters. </p> <p>\"I'm done hurting her. She's been hurt enough. It's time I set her free...\" </p> <p>Once upon a time, I wished to go home and forget. </p> <p>Now, I'm strong and ready to fight. </p> <p>Seduced and claimed, Elder no longer just demands my voice, he commands me to be a thief like him. </p> <p>I refuse. </p> <p>But he offers me things I shouldn't want, favors I should run from. </p> <p>In return for his protection, I'm ordered to steal enough pennies and dollars to buy back my freedom. </p> <p>Only, we both aren't prepared for how he changes me, evolves me. </p> <p>And now it's my turn to learn about him.... </p> <p>Third book in the Dollar series. All full-length books. </p>"; 
